    private void jButton3ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton3ActionPerformed
        // TODO add your handling code here:
        if(bot.isSelected()){
            
            Denuncia denun = new Denuncia(Integer.parseInt(año.getText()),Integer.parseInt(mes.getText()),Integer.parseInt(dia.getText()),causa.getText(),Integer.parseInt(importe.getText()),Integer.parseInt(ncarne.getText()));
            Expediente exp = new Expediente(denun);
            
            mensaje.setText("guardado correctamente");
        }
        else if(bot2.isSelected()){
            Denuncia denun = new Denuncia(Integer.parseInt(año.getText()),Integer.parseInt(mes.getText()),Integer.parseInt(dia.getText()),causa.getText(),Integer.parseInt(importe.getText()),matricula.getText());
            Expediente exp = new Expediente(denun);
            mensaje.setText("guardado correctamente");
        }
       
    }//GEN-LAST:event_jButton3ActionPerformed

