    private void jButton2ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton2ActionPerformed
        // TODO add your handling code here:
        if (bot.isSelected()){
            Conductor condu = Conductor.busquedaCarnet(Integer.parseInt(ncarne.getText()));
            if (condu != null){
            nomm.setText(condu.getNombre());
            prenom.setText(condu.getApellidos());
            diir.setText(condu.getDireccion());
            em.setText(condu.getEmail());
            carnet.setText(Integer.toString(condu.getCarnet().getNumeroId()));
            }
        }
        else if(bot2.isSelected()){
            Conductor condu = Conductor.busquedaMatricula((matricula.getText()));
            if (condu != null){
            nomm.setText(condu.getNombre());
            prenom.setText(condu.getApellidos());
            diir.setText(condu.getDireccion());
            em.setText(condu.getEmail());
            carnet.setText(Integer.toString(condu.getCarnet().getNumeroId()));
            }
        }
    }//GEN-LAST:event_jButton2ActionPerformed

